import React from "react";

function Header (props) {
    return (
        <div id="header">
            <img src="https://fontmeme.com/permalink/190427/a19c06ccfb80db6b487e3c53b349dd82.png" alt="Redshirt Roulette" id="logo"/>
            <span>Logo Goes Here</span> <span>You guessed right/wrong!</span> <span>Score: {props.currentScore} | Top Score: 12</span>
        </div>
    )
}

export default Header;
